import React from 'react';
import logo from './logo.svg';
import './App.css';
import ReactImageZoom from 'react-image-zoom';

function App() {
  const props = {width: 400, height: 250, zoomWidth: 500, img: require('./1.jpg')}
  return (
    <div className="App">
      <img src={require('./1.jpg')}/>
      <ReactImageZoom {...props} />
    </div>
  );
}

export default App;
